iceandfire.vgdl:
class VGDLGame extends Game {
    SpriteSet {
        Wall: Wall;
        Avatar: Controllable;
        Chip: Collectible;
        Exit: Goal;
        Fireboots: Powerup;
        Fire: Damaging;
        Trap: Damaging;
        Ice: Static;
        Iceshoes: Powerup;
    }
    LevelMapping {
        "wall": Wall;
        "avatar": Avatar;
        "chip": Chip;
        "exit": Exit;
        "fireboots": Fireboots;
        "fire": Fire;
        "trap": Trap;
        "ice": Ice;
        "iceshoes": Iceshoes;
    }
    InteractionSet {
        // Avatar interactions
        Interaction(Avatar, Wall, Block);
        Interaction(Avatar, Chip, Collect);
        Interaction(Avatar, Exit, GameWin);
        Interaction(Avatar, Fireboots, Powerup);
        Interaction(Avatar, Iceshoes, Powerup);
        Interaction(Avatar, Trap, Damage(Avatar));

        // Fire interactions: Only damage if no Fireboots
        Interaction(Avatar, Fire, HasNot(Fireboots), Damage(Avatar));

        // Ice interactions: Only pass through if Iceshoes equipped
        Interaction(Avatar, Ice, HasNot(Iceshoes), Block);
        Interaction(Avatar, Ice, Has(Iceshoes), PassThrough);
    }
    TerminationSet {
        WinGoal: GoalReached;
        DeathGoal: AvatarKilled;
    }
}

