      "ACTION_USE"
    ],
    "GlobalMechanics": {
      "MovementSpeed": "Avatar moves 1 tile per action unless blocked."
    },
    "InteractionMechanics": {
      "AvatarMovement": {
        "CollisionRules": {
          "wall": "Blocks movement",
          "boulder": "If moving into boulder, check if next tile is dirt. If yes, boulder moves forward and avatar moves into boulder's original position. Else, avatar stays."
        },
        "ActionUse": {
          "spawn_sword": "On ACTION_USE, spawn sword at avatar's current position (if possible)."
        }
      },
      "HealthMechanics": {
        "crab_collision": "Avatar loses 1 HP on collision with crab."
      },
      "TerminationTriggers": {
        "exitdoor": "Avatar entering exitdoor triggers win.",
        "health_zero": "Avatar HP <=0 triggers loss."
      }
    },
    "RewardMechanics": {
      "ExitReward": "Reward += 100 upon exiting.",
      "DiamondCollect": "Reward +=1 for each diamond collected."
    },
    "TerminationMechanics": {
      "WinCondition": "avatar_position == exitdoor_position",
      "LossCondition": "avatar_health <= 0"
    },
    "LevelEncoding": {
      "InitialGrid": "ASCII grid from first observation (boulderchase.txt: first_10)",
      "EntityMap": {
        "wall": "Static",
        "avatar": "Start position (row 8, column 9 in initial grid)",
        "exitdoor": "Position in last rows"
      }
    }
  },
  "dynamic_variables": {
    "StateVariables": {
      "avatar_position": {
        "Equation": "avatar_position_{t+1} = move_in_direction(Action_t) if unblocked; else avatar_position_t"
      },
      "avatar_health": {
        "Equation": "avatar_health_{t+1} = avatar_health_t - 1 if collided_with_crab_t; else avatar_health_t"
      },
      "boulder_positions": {
        "Equation": "boulder_positions_{t+1} = update if avatar_pushes_boulder_t"
      },
      "has_sword": {
        "Equation": "has_sword_{t+1} = True if ACTION_USE_t and valid; else has_sword_t"
      },
      "diamonds_collected": {
        "Equation": "diamonds_collected_{t+1} = diamonds_collected_t + 1 if avatar_steps_on_diamond_t; else diamonds_collected_t"
      },
      "exit_reached": {
        "Equation": "exit_reached_{t+1} = True if avatar_position_{t+1} == exitdoor_position; else False"
      }
    },
    "Reward": {
      "Equation": "Reward_t = 100 * exit_reached_t + diamonds_collected_t"
    },
    "Termination": {
      "Equation": "Termination_t = (exit_reached_t) OR (avatar_health_t <= 0)"
    }
  },
  "edges": {
    "EntityTypes->InitialState": true,
    "LevelEncoding->InitialState": true,
    "EntityTypes->StateVariables": true,
    "ActionSpace->InteractionMechanics": true,
    "ActionSpace->StateVariables": true,
    "GlobalMechanics->StateVariables": true,
    "InteractionMechanics->StateVariables": true,
    "StateVariables->InteractionMechanics": true,
    "StateVariables->RewardMechanics": true,
    "InteractionMechanics->RewardMechanics": true,
    "RewardMechanics->StateVariables": false,
    "StateVariables->TerminationMechanics": true,
    "InteractionMechanics->TerminationMechanics": true
  }
}
```

### Explanation:
- **EntityTypes**: Includes all observed entities (e.g., avatar, wall, boulder). Attributes like "collectible" for diamonds or "destructible" for boulders are inferred from interactions.
- **ActionSpace**: Lists directional movements and an action to spawn a sword.
- **InteractionMechanics**: Avatar movement rules (e.g., pushing boulders) and health loss from crab collisions.
- **Reward**: Scores from exiting and collecting diamonds.
- **Termination**: Ends on exiting or low health.
- **StateVariables**: Track avatar position, health, boulder positions, and game state.
- **Equations**: Define transitions based on actions and collisions (e.g., avatar moves only if path is clear).

