      "InteractionMechanics": ["ACTION_DOWN", "ACTION_RIGHT", "ACTION_LEFT", "ACTION_NIL"],
      "StateVariables": ["avatar_position"]
    },
    "GlobalMechanics": {"StateVariables": ["hp"]},
    "InteractionMechanics": {
      "StateVariables": ["avatar_position", "hp", "inventory", "on_fire", "on_ice"],
      "RewardMechanics": ["collect_chip", "exit_reward", "trap_penalty"],
      "TerminationMechanics": ["exit_reached", "hp_depleted"]
    },
    "RewardMechanics": {"StateVariables": ["hp", "inventory"]},
    "TerminationMechanics": {"StateVariables": ["avatar_position", "hp"]}
  },
  "equations": {
    "avatar_position_{t+1}": "if Action_t is valid (not wall), avatar moves in direction; else stays",
    "hp_{t+1}": "hp_t - (damage if on_fire && !inventory.fireboots)",
    "inventory_{t+1}": "inventory_t ∪ item if avatar collides with item (fireboots/iceshoes)",
    "on_fire_{t+1}": "true if avatar is on fire tile",
    "on_ice_{t+1}": "true if avatar is on ice tile",
    "Reward_t": "sum(chip_count * 1 + exit_flag * 100 - trap_damage)",
    "Termination_t": "exit_reached if avatar at exit; hp_depleted if hp_t <=0"
  }
}
```

### Explanation:
- **EntityTypes**: Defines all objects in the game.
- **ActionSpace**: Includes movement and nil actions.
- **GlobalMechanics**: Fire causes damage over time unless fireboots are equipped.
- **InteractionMechanics**: 
  - Walls block movement.
  - Collecting items (fireboots/iceshoes) modifies inventory.
  - Avatar on fire reduces HP without fireboots.
  - Ice tiles modify movement (requires iceshoes for normal movement).
- **RewardMechanics**: Chips reward +1, exit gives +100, traps penalize.
- **TerminationMechanics**: Win on exit, lose if HP <=0.
- **Equations**: Explicitly model state transitions and causal effects of actions/collisions.

