### Explanation:
1. **EntityTypes**: Defines static objects (walls, pits) and dynamic camels with directional movement.
2. **ActionSpace**: Player actions set direction or maintain it.
3. **InteractionMechanics**: Camels move based on direction, stopping at walls or triggering termination on pits/goals.
4. **Reward/Termination**: Positive/negative rewards for goals/pits, ending the game on collision.
5. **Equations**: Positions update directionally, with collision checks. Game ends on goal/pit contact.

