1. **Ice Movement**: Avatar slides on ice until hitting a wall (from consistent avatar movement in ice rows).
2. **Item Effects**: Fireboots negate fire damage; iceshoes enable sliding on ice.
3. **Collision Rules**: 
   - Traps deal damage.
   - Collecting chips removes them and gives reward.
   - Exiting triggers win condition.
4. **Termination**: Game ends if avatar dies (HP=0) or reaches exit.

This model follows VGDL conventions by separating static entity definitions (EntityTypes) from dynamic state variables, and maps interactions to game mechanics using causal equations.

