3. **GlobalMechanics**: Camels move right each step until reaching the goal's x-coordinate.
4. **InteractionMechanics**: When a camel reaches the goal, check if the avatar's bet matches the camel's type.
5. **StateVariables**: Track camel positions, avatar's bet, and game termination status.
6. **Reward/Termination**: Binary reward based on bet matching the winning camel. Game ends when any camel reaches the goal.
7. **Equations**: Dynamic camel movement and bet updates are modeled discretely. The reward and termination are conditional on goal collision and bet match.
